Whity 1971



&quot;Whity&quot; is the mulatto butler of the dysfunctional Nicholson family in the American southwest in 1878. The father, Ben Nicholson, has an attractive young wife Katherine, and two sons by a previous marriage; the homosexual Frank, and the retarded Davy. Whity tries to carry out all their orders, however demeaning, until various of the family members ask him to kill some of the others.




